import React, { Component } from 'react';

class tablefont extends Component {
    render() {
        return (
            <table className="table">

                <tbody>
                    <tr>
                        <td></td>
                        <td>
                            <span className="overline text-light-gray"> color</span>
                        </td>
                    </tr>
                </tbody>

            </table>
        );
    }
}

export default tablefont;
